// TalentItem.js
import React from 'react';
import { Row, Col, Form } from 'react-bootstrap';

function TalentItem({ talent, onChange, index }) {
  return (
    <Row className="mt-3">
      <Col>
        <Form.Control
          type="text"
          placeholder="Talent Name"
          value={talent.name}
          onChange={(e) => onChange(index, { ...talent, name: e.target.value })}
        />
      </Col>
      <Col>
        <Form.Control
          type="text"
          placeholder="Contract Duration"
          value={talent.contractDuration}
          onChange={(e) => onChange(index, { ...talent, contractDuration: e.target.value })}
        />
      </Col>
      <Col>
        <Form.Control
          type="number"
          placeholder="Bill Rate"
          value={talent.billRate}
          onChange={(e) => onChange(index, { ...talent, billRate: e.target.value })}
        />
      </Col>
      <Col>
        <Form.Control
          as="select"
          value={talent.currency}
          onChange={(e) => onChange(index, { ...talent, currency: e.target.value })}
        >
          <option value="">Select Currency</option>
          <option value="USD">USD - Dollars ($)</option>
          {/* Add more currency options as needed */}
        </Form.Control>
      </Col>
    </Row>
  );
}

export default TalentItem;
